<p>To summarize this issue, it's basically causing my program to exit or crash when an error is thrown by mongoose. When I first encountered this error, I tried fitting my program with more error handling. However, after all the effort the program still crashes from an error that is thrown. I think it's because somewhere where an error isn't handled but I can't seem to find where that is.</p>
<p>This is my database module, and the way I error handle.</p>
