Fetch data from two Mongodb databases in MERN stack<p>In a MERN stack app, I'm trying to fetch data from two Mongodb databases and store them in context state, but I can only ever get one or the other depending on the order they are in.</p>
<p><code>App.js</code>. In this case, the second <code>useEffect</code> hook works but not the first.</p>
<pre><code>import { useEffect } from 'react';
import { useClosetContext } from './hooks/useClosetContext';

function App() {
  const { dispatch } = useClosetContext()

  useEffect(() =&gt; {

    const fetchCloset = async () =&gt; {
      const response = await fetch('/api/closet')
      const json = await response.json()

      if (response.ok) {
        dispatch({type:'SET_CLOSET', payload: json})
      }
    }

    fetchCloset()

  }, [dispatch])

  useEffect(() =&gt; {

    const fetchSavedLists = async () =&gt; {
        const response = await fetch('/api/checklist')
        const json = await response.json()

        if (response.ok) {
          dispatch({type:'SET_CHECKLISTS', payload: json})
        }
      }

    fetchSavedLists()

  }, [dispatch])

  return (
    &lt;div className=&quot;App&quot;&gt;...&lt;/div&gt;
  );
}

export default App;
</code></pre>
<p>I have tried putting both the <code>fetchCloset()</code> and <code>fetchSavedLists()</code> functions in the same <code>useEffect</code> hook, but I get the same results.</p>
<p>I also tried this, but didn't get anything:</p>
<pre><code>useEffect(() =&gt; {
  const fetchData = () =&gt; {
      Promise.all([
        fetch('/api/closet'),
        fetch('/api/checklist')
      ]).then(([closet, checklist]) =&gt; {
        dispatch({type:'SET_CLOSET', payload: closet})
        dispatch({type:'SET_CHECKLISTS', payload: checklist})
      }).catch(err =&gt; {
        console.log(err)
      })
    }

  fetchData()
}, [dispatch])
</code></pre>
<p>Here is my Context file:</p>
<pre><code>import { createContext, useReducer } from &quot;react&quot;;

export const ClosetContext = createContext()

export const closetReducer = (state, action) =&gt; {
  switch (action.type) {
    case 'SET_CLOSET':
      return {
        closet: action.payload
      }
    case 'CREATE_GEAR':
      return {
        closet: [action.payload, ...state.closet]
      }
    case 'SET_CHECKLISTS':
      return {
        checklists: action.payload
      }
    case 'CREATE_CHECKLIST':
      return {
        checklists: [action.payload, ...state.checklists]
      }
    default:
      return state
  }
}

export const ClosetContextProvider = ({ children }) =&gt; {
  const [state, dispatch] = useReducer(closetReducer, {
    closet: null,
    checklists: null
  })

  return (
    &lt;ClosetContext.Provider value={{...state, dispatch}}&gt;
      { children }
    &lt;/ClosetContext.Provider&gt;
  );
}
</code></pre>
<p>Context Hook:</p>
<pre><code>import { useContext } from &quot;react&quot;;
import { ClosetContext } from &quot;../context/ClosetContext&quot;;

export const useClosetContext = () =&gt; {
  const context = useContext(ClosetContext)

  if (!context) {
    throw Error('error')
  }

  return context
}
</code></pre>
<p>I don't think there is anything wrong with the backend because I can fetch the data separately. Is there any way I can fetch both databases and set them to Context state?</p>

