$group and sum + add all greater than<p>Let's say my documents look like this:</p>
<pre><code>[
  {
    name: &quot;Example 1&quot;,
    year: &quot;2012&quot;
  },
  {
    name: &quot;Example 2&quot;,
    year: &quot;2012&quot;
  },
  {
    name: &quot;Example 3&quot;,
    year: &quot;2013&quot;
  },
  {
    name: &quot;Example 4&quot;,
    year: &quot;2014&quot;
  }
]
</code></pre>
<p>Using an <strong>aggregation</strong>, is there a way to <strong>group by year and sum the document count</strong>, but additionally <strong>add the sum of all later years</strong>?</p>
<p>The <strong>result</strong> I want is this:</p>
<pre><code>[
    {
        _id: &quot;2012&quot;,
        count: 4 // years 2012-2014
    },
    {
        _id: &quot;2013&quot;,
        count: 2 // years 2013-2014
    },
    {
        _id: &quot;2014&quot;,
        count: 1 // only year 2014
    }
]
</code></pre>
<p>Right now, I'm using a normal <code>$group</code> + <code>$sum</code>, which gives me the counts for each year individually and then I sort them in JavaScript. I was hoping that there was a simpler way that gets rid of the additional JS code:</p>
<pre><code>yearCounts: [           
    { $group: { _id: &quot;$year&quot;, count: { $sum: 1 } } }
]
</code></pre>
<pre><code>const yearCounts: { _id: string, count: number }[] = aggregationResult[0].yearCounts || [];
const yearCountsSummed = yearCounts.map((yearCount: { _id: string, count: number }) =&gt; {
    const yearsUntil = yearCounts.filter(year =&gt; year._id &gt;= yearCount._id);
    const countSummed = yearsUntil.map(yearCount =&gt; yearCount.count).reduce((a, b) =&gt; a + b) || 0;
    return countSummed;
});
</code></pre>

