  running: Boolean
  executedAt: Date,
  next: Number (millisecond)
}
</code></pre>
<p>I wish to fetch Tasks which should be executed meaning the sum of <code>executedAt + next &lt; now</code>
Since the scheduler should lock the Task, the <code>running</code> flag should be flipped to true in the same operation, hence I'm using <code>findOneAndUpdate()</code>
I'm stuck at dealing with the sum of executedAt and next. How would one compare the sum of these to <code>new Date/Date.now()</code> ?</p>
<p>When doing an aggregation one could use <code>$dateAdd</code> from what I understand so in a find query could be something. like the following:</p>
<pre><code>    Task.find({
      $and: [
        { running: { $ne: null } },
        { running: false },
        { next: { $ne: null } },
        { executedAt: { $ne: null } },
        {
          $expr: {
            $lt: [
              {
                $dateAdd: {
                  startDate: '$executedAt',
                  unit: 'millisecond',
                  amount: '$next',
                },
              },
              new Date().toUTCString(),
            ],
          },
        },
      ],
    })
</code></pre>
<p>However this does not work.</p>

